import styled from "styled-components";

const Father = styled.div`
  display: fles;
`

const BoxOne = styled.div`
  background-color: teal;
  width: 100px;
  height: 100px;
`

const BoxTwo = styled.div`
  background-color: tomato;
  width: 100px;
  height: 100px;
`
const Text = styled.span`
  color: white;
`

function App() {
  return (
    <Father>
      <Box></Box>
    </Father>
  );
}

export default App;
